import React from "react";
import css from "./index.module.scss";
function Home() {
  console.log(process.env);
  return (
    <div className={css.root}>
      {/* <Header />
      <Content/> */}
      <header>
        <div className={css.nav}>
          <ul>
            <li>Star Wars movies</li>
            <li>Star Wars Characters</li>
          </ul>
        </div>
      </header>
    </div>
  );
}

export default Home;
